import React, { Component } from 'react';

class Control extends Component {
  render() {
    return (
    <ul>
        <li><a href="/create">create</a></li>
        <li><a href="/update">update</a></li>
        <li><input type="button" value="delete"/></li>              
    </ul>
    );
  }
}

export default Content;
